eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__),\n/* harmony export */   proyectos: () => (/* binding */ proyectos)\n/* harmony export */ });\nconst proyectos = [\n    {\n        slug: \"planta-filtros\",\n        title: \"Planta de Filtros Industrial\",\n        date: \"2024-08-15\",\n        excerpt: \"Implementación de sistema avanzado de filtración para tratamiento de aguas industriales con tecnología de última generación\",\n        cover: \"/brand/proyecto-filtros.jpg\",\n        gallery: [\n            \"/brand/proyecto-filtros-1.jpg\",\n            \"/brand/proyecto-filtros-2.jpg\",\n            \"/brand/proyecto-filtros-3.jpg\"\n        ],\n        featured: true,\n        client: \"Industrias Químicas del Mediterráneo S.L.\",\n        location: \"Valencia, España\",\n        duration: \"8 meses\",\n        tags: [\n            \"Filtración\",\n            \"Aguas Industriales\",\n            \"Sostenibilidad\",\n            \"Tecnología Avanzada\"\n        ],\n        environmentalAuthorizations: [\n            \"157/G02/CV - ALMACENAMIENTO RESIDUOS PELIGROSOS\",\n            \"33383/P02/CV - PEQUEÑO PRODUCTOR RESID.PELIGROSOS\",\n            \"1021/G04/CV - TRATAMIENTO RESIDUOS NO PELIGROSOS\"\n        ],\n        body: `## Implementación de Planta de Filtros de Alta Eficiencia\n\nLa implementación de esta planta de filtros representa un hito en el tratamiento avanzado de aguas industriales, combinando tecnología de vanguardia con procesos sostenibles para garantizar la máxima eficiencia en la purificación.\n\n### Tecnología Implementada\n\n**Sistema de Filtración Multicapa**: Diseño innovador con múltiples etapas de filtración que incluye pre-filtros, filtros de carbón activado y membranas de ultrafiltración de última generación.\n\n**Control Automatizado**: Sistema de monitorización continua con sensores IoT que permite el control remoto de todos los parámetros operativos, garantizando una operación óptima 24/7.\n\n**Eficiencia Energética**: Incorporación de tecnología de recuperación energética que reduce el consumo eléctrico en un 40% comparado con sistemas convencionales.\n\n### Proceso de Filtración\n\nEl agua industrial pasa por un proceso de tratamiento en cinco fases:\n\n1. **Pre-tratamiento**: Eliminación de sólidos en suspensión y sedimentos gruesos\n2. **Filtración primaria**: Retención de partículas mediante filtros de arena y grava\n3. **Filtración secundaria**: Purificación con carbón activado para eliminación de compuestos orgánicos\n4. **Ultrafiltración**: Membrana de alta tecnología para retención de microcontaminantes\n5. **Desinfección final**: Tratamiento UV para eliminación de patógenos residuales\n\n### Autorizaciones Medioambientales\n\nEste proyecto se ejecuta bajo el marco de nuestras autorizaciones medioambientales:\n- **157/G02/CV**: Almacenamiento de residuos peligrosos en Serra d'Espadà\n- **33383/P02/CV**: Pequeño productor de residuos peligrosos en Serra d'Espadà\n- **1021/G04/CV**: Tratamiento de residuos no peligrosos en Comarca l'Horta\n\n### Resultados y Beneficios\n\n**Calidad del agua**: Mejora del 95% en los parámetros de calidad del agua tratada, cumpliendo con las normativas más exigentes.\n\n**Reducción de residuos**: Disminución del 60% en la generación de lodos y residuos del proceso gracias a la tecnología de concentración.\n\n**Sostenibilidad**: Reutilización del 85% del agua tratada en procesos industriales, contribuyendo significativamente a la economía circular.\n\n**Certificación ambiental**: La planta ha obtenido certificación ISO 14001 y cumple con todos los estándares europeos de calidad ambiental.\n\n### Innovación y Futuro\n\nEsta instalación sirve como planta piloto para futuras implementaciones, incorporando sistemas de inteligencia artificial para la optimización predictiva del rendimiento y el mantenimiento preventivo automatizado.`\n    },\n    {\n        slug: \"gestion-residuos\",\n        title: \"Gestión Integral de Residuos Industriales\",\n        date: \"2024-06-20\",\n        excerpt: \"Proyecto completo de gestión sostenible de residuos para complejo industrial con enfoque en economía circular\",\n        cover: \"/brand/proyecto-gestion.jpg\",\n        gallery: [\n            \"/brand/proyecto-gestion-1.jpg\",\n            \"/brand/proyecto-gestion-2.jpg\",\n            \"/brand/proyecto-gestion-3.jpg\"\n        ],\n        featured: true,\n        client: \"Complejo Industrial Sagunto\",\n        location: \"Sagunto, Valencia\",\n        duration: \"12 meses\",\n        tags: [\n            \"Gestión Residuos\",\n            \"Economía Circular\",\n            \"Sostenibilidad\",\n            \"Logística\"\n        ],\n        environmentalAuthorizations: [\n            \"374/G04/CV - TRATAMIENTO RESIDUOS NO PELIGROSOS\",\n            \"3873/P04/CV - PEQUEÑO PRODUCT.RESID.NO PELIGROSOS\",\n            \"79/T01/CV - TRANSPORTISTA RESIDUOS PELIGROSOS\",\n            \"361/T02/CV - TRANSPORTISTA RESID. NO PELIGROSOS\"\n        ],\n        body: `## Sistema Integral de Gestión de Residuos Industriales\n\nEste proyecto revoluciona la gestión de residuos en el complejo industrial, implementando un sistema integral que transforma los residuos en recursos aprovechables mediante tecnología avanzada y procesos de economía circular.\n\n### Análisis y Diagnóstico\n\n**Caracterización de residuos**: Análisis exhaustivo de los 23 tipos diferentes de residuos generados, incluyendo metales, plásticos, aceites usados, residuos químicos y materiales compuestos.\n\n**Auditoría de procesos**: Evaluación completa de los procesos productivos para identificar oportunidades de reducción en origen y optimización de flujos de residuos.\n\n**Estudio de viabilidad**: Análisis económico y técnico de las diferentes alternativas de tratamiento y valorización disponibles.\n\n### Implementación del Sistema\n\n**Segregación en origen**: Instalación de 45 puntos de recogida selectiva estratégicamente ubicados en las diferentes áreas del complejo, con señalización visual intuitiva y contenedores especializados.\n\n**Sistema de trazabilidad digital**: Implementación de código QR y tecnología RFID para el seguimiento completo de cada residuo desde su generación hasta su destino final.\n\n**Centro de consolidación**: Construcción de una plataforma logística de 2.000 m² para el almacenamiento temporal, consolidación y preparación de residuos para su transporte.\n\n### Tecnología de Tratamiento\n\n**Planta de clasificación automática**: Sistema robotizado con tecnología de visión artificial para la separación automática de residuos mixtos.\n\n**Tratamiento físico-químico**: Procesos especializados para la recuperación de metales valiosos y la neutralización de residuos peligrosos.\n\n**Biodigestión anaeróbica**: Tratamiento de residuos orgánicos para la generación de biogás y fertilizante orgánico.\n\n### Marco Regulatorio y Autorizaciones\n\nEl proyecto opera bajo el amparo de nuestras autorizaciones medioambientales:\n- **374/G04/CV**: Tratamiento de residuos no peligrosos en Serra d'Espadà\n- **3873/P04/CV**: Pequeño productor de residuos no peligrosos en Serra d'Espadà\n- **79/T01/CV**: Transportista autorizado de residuos peligrosos\n- **361/T02/CV**: Transportista de residuos no peligrosos con trazabilidad completa\n\n### Resultados Alcanzados\n\n**Reducción de residuos**: Disminución del 78% en residuos destinados a vertedero mediante procesos de valorización y reciclaje.\n\n**Generación de valor**: Recuperación de materias primas secundarias por valor de 2.3M€ anuales, convirtiendo el coste de gestión en una fuente de ingresos.\n\n**Eficiencia logística**: Optimización de rutas que redujo en 65% los desplazamientos de vehículos de recogida.\n\n**Cumplimiento normativo**: 100% de conformidad con auditorías ambientales y certificación bajo estándares ISO 14001 e ISO 45001.\n\n### Impacto Ambiental y Social\n\n**Huella de carbono**: Reducción de 1.240 toneladas de CO₂ equivalente anuales gracias a los procesos de valorización y la optimización logística.\n\n**Economía circular**: El proyecto ha servido como modelo de referencia para otros complejos industriales de la región.\n\n**Empleo local**: Creación de 15 puestos de trabajo especializados en gestión ambiental y tecnología de residuos.\n\n### Innovación Continua\n\nEl sistema incorpora inteligencia artificial para la optimización predictiva de rutas de recogida y la planificación automática del mantenimiento de equipos, posicionándose como referente en la industria 4.0 aplicada a la gestión de residuos.`\n    },\n    {\n        slug: \"tramitacion-medioambiental\",\n        title: \"Tramitación y Documentación Medioambiental\",\n        date: \"2024-04-10\",\n        excerpt: \"Gestión completa de permisos y documentación ambiental para proyectos industriales con garantía de cumplimiento normativo\",\n        cover: \"/brand/proyecto-tramitacion.jpg\",\n        gallery: [\n            \"/brand/proyecto-tramitacion-1.jpg\",\n            \"/brand/proyecto-tramitacion-2.jpg\"\n        ],\n        client: \"Múltiples Clientes Industriales\",\n        location: \"Comunidad Valenciana\",\n        duration: \"Servicio continuo\",\n        tags: [\n            \"Tramitación\",\n            \"Normativa\",\n            \"Compliance\",\n            \"Documentación\"\n        ],\n        environmentalAuthorizations: [\n            \"157/G02/CV - ALMACENAMIENTO RESIDUOS PELIGROSOS\",\n            \"33383/P02/CV - PEQUEÑO PRODUCTOR RESID.PELIGROSOS\",\n            \"1021/G04/CV - TRATAMIENTO RESIDUOS NO PELIGROSOS\",\n            \"374/G04/CV - TRATAMIENTO RESIDUOS NO PELIGROSOS\"\n        ],\n        body: `## Servicio Integral de Tramitación Medioambiental\n\nNuestro servicio de tramitación medioambiental garantiza el cumplimiento normativo completo para proyectos industriales, gestionando todos los aspectos regulatorios desde la planificación inicial hasta la obtención de las autorizaciones definitivas.\n\n### Ámbito de Actuación\n\n**Autorizaciones ambientales integradas**: Tramitación completa de AAI para instalaciones industriales, incluyendo evaluación de impacto ambiental y medidas correctoras.\n\n**Licencias de gestión de residuos**: Obtención de autorizaciones específicas para la gestión, tratamiento y valorización de residuos peligrosos y no peligrosos.\n\n**Permisos de emisiones**: Gestión de autorizaciones para emisiones atmosféricas, vertidos y contaminación acústica.\n\n### Proceso de Tramitación\n\n**Fase de análisis**: Evaluación exhaustiva del proyecto industrial y identificación de todos los requisitos normativos aplicables según la legislación autonómica, nacional y europea.\n\n**Elaboración documental**: Preparación de toda la documentación técnica necesaria, incluyendo estudios de impacto ambiental, planes de gestión de residuos y memorias técnicas especializadas.\n\n**Presentación y seguimiento**: Gestión completa ante las administraciones competentes, seguimiento del expediente y resolución de requerimientos administrativos.\n\n**Implementación**: Asesoramiento en la implementación de las medidas autorizadas y seguimiento del cumplimiento de las condiciones impuestas.\n\n### Especialización Técnica\n\n**Residuos industriales**: Tramitación especializada en autorizaciones de gestión de residuos, con experiencia en más de 200 expedientes exitosos.\n\n**Instalaciones de tratamiento**: Permisos para plantas de tratamiento físico-químico, biológico y térmico de residuos.\n\n**Transporte especializado**: Autorizaciones de transporte para residuos peligrosos y mercancías especiales.\n\n### Marco Normativo de Referencia\n\nNuestro equipo mantiene nuestras propias autorizaciones como referencia de excelencia:\n- **157/G02/CV**: Gestión de residuos peligrosos con capacidad de 50.000 Tn/año\n- **33383/P02/CV**: Tratamiento de residuos metálicos y valorización material\n- **1021/G04/CV**: Gestión de residuos no peligrosos con operaciones de clasificación\n- **374/G04/CV**: Operaciones de valorización y recuperación de materiales\n\n### Servicios Complementarios\n\n**Auditorías de cumplimiento**: Evaluación periódica del cumplimiento de las condiciones ambientales y identificación de mejoras.\n\n**Reporting y documentación**: Elaboración de informes anuales de gestión, memorias ambientales y documentación para renovaciones.\n\n**Formación especializada**: Capacitación del personal en cumplimiento normativo y buenas prácticas ambientales.\n\n**Asesoramiento jurídico**: Soporte legal especializado en derecho ambiental y resolución de incidencias administrativas.\n\n### Casos de Éxito\n\n**Industria química**: Tramitación exitosa de 15 AAI para plantas químicas con procesos complejos y residuos especiales.\n\n**Sector metalúrgico**: Gestión de permisos para 8 instalaciones de tratamiento de residuos metálicos con autorización de operaciones R4 y R5.\n\n**Logística industrial**: Autorizaciones de gestión para 12 centros logísticos con almacenamiento temporal de residuos.\n\n### Garantías de Servicio\n\n**Plazo garantizado**: Compromiso de tramitación en los plazos legales establecidos con seguimiento proactivo del expediente.\n\n**Actualización normativa**: Servicio continuo de seguimiento de cambios normativos y adaptación de autorizaciones vigentes.\n\n**Soporte técnico 24/7**: Asistencia técnica inmediata para resolución de incidencias y cumplimiento de requerimientos urgentes.\n\n### Valor Añadido\n\nNuestro conocimiento práctico como gestores autorizados nos permite ofrecer asesoramiento basado en experiencia real, garantizando que las autorizaciones obtenidas sean viables técnica y económicamente, evitando sorpresas en la fase de implementación.\n\nLa documentación que elaboramos ha superado el 98% de las auditorías administrativas sin requerimientos adicionales, demostrando la calidad técnica y el rigor de nuestro trabajo.`\n    }\n];\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (proyectos);\n\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./content/proyectos.ts\n");

